class Game {

    constructor(dimension) {
        console.log(this.blankGrid())
    }

    blankGrid(dimension) {
        const grid = [];
        for(let i = 0; i < dimension; i++) {
            grid.push(Array(dimension).fill(0));
        }
        return grid;
    }
}

export default Game;
